        getBarLineOption: function(opt) {
            var option = {
                tooltip: {
                    trigger: 'axis',
                    axisPointer: {
                        type: 'cross',
                        crossStyle: {
                            color: '#999'
                        }
                    }
                },
                legend: {
                    top: 10,
                    itemHeight: 10,
                    itemWidth: 15
                },
                xAxis: [{
                    type: 'category',
                    axisPointer: {
                        type: 'shadow'
                    },
                    axisLabel: {
                        formatter: function(value, index) {
                            var text = value;
                            if (value.indexOf('日') != -1) {
                                text = new Date(value.replace('年', '-').replace('月', '-').replace('日', '')).Format('yy-MM');
                            } else if (value.indexOf('月') != -1) {
                                text = new Date(value.replace('年', '-').replace('月', '')).Format('yy-MM');
                            } else if (value.indexOf('年') != -1) {
                                text = value.replace('年', '');
                            }
                            return text;
                        }
                    }
                }]
            };
            $.extend(true, option, opt);
            return option;
        },

