        render_r_1: function(resultData) {

            var clone = resultData.slice();
            clone[0].splice(0, 1);
            clone[1].splice(0, 1);

            var myChart = echarts.init(document.getElementById('chart-r-1'), 'dark');
            var option = this.getBarLineOption({
                color: ['#00fffc'],
                tooltip: {
                    trigger: 'item'
                },
                grid: {
                    top: 40,
                    left: 60,
                    right: 20,
                    bottom: 35
                },
                legend: {
                    data: ['苹果主产国生产效率']
                },
                xAxis: [{
                    type: 'category',
                    data: clone[0],
                    nameRotate: 20,
                    axisPointer: {
                        type: 'shadow'
                    },
                    axisLabel: {
                        interval: 0,
                        fontSize: 8,
                        fontWeight: 100,
                        textStyle: {
                            color: '#9faeb5',
                        },
                        formatter: function(value) {
                            var ret = ""; //拼接加\n返回的类目项
                            var maxLength = 1; //每项显示文字个数
                            var valLength = value.length; //X轴类目项的文字个数
                            var rowN = Math.ceil(valLength / maxLength); //类目项需要换行的行数
                            if (rowN > 1) //如果类目项的文字大于3,
                            {
                                for (var i = 0; i < rowN; i++) {
                                    var temp = ""; //每次截取的字符串
                                    var start = i * maxLength; //开始截取的位置
                                    var end = start + maxLength; //结束截取的位置
                                    //这里也可以加一个是否是最后一行的判断，但是不加也没有影响，那就不加吧
                                    temp = value.substring(start, end) + "\n";
                                    ret += temp; //凭借最终的字符串
                                }
                                return ret;
                            } else {
                                return value;
                            }
                        },
                    }
                }],
                yAxis: [{
                    type: 'value',
                    name: '千克/公顷',
                    nameTextStyle: {
                        padding: [0, 0, 0, 20]
                    },
                    splitLine: {
                        show: false
                    }
                }],
                series: [{
                    type: 'bar',
                    name: "苹果主产国生产效率",
                    barWidth: 6,
                    data: clone[1]
                }]
            });
            myChart.setOption(option);
        },
